import React from "react";
import {connect} from "react-redux";


const CounterComponent = ({counter = 234}) =>
    <div>
      <h1>Counter</h1>
      {counter}
    </div>

//export default CounterComponent

const stateToPropertyMapper = (state) => ({
  counter: state.count
})

export default connect
(stateToPropertyMapper)
(CounterComponent)
